In the early hours of 31st August 1888 a man is walking to work down a dark lane in Whitechapel, he sees a shapeless bundle lying on the ground near some gates, curious he goes over to investigate. His gruesome discovery of a murdered East End prostitute then started one of the most famous man hunts in the world. Ripperologists and amateur sleuths to this day are still trying to work out the identity of a man they called Jack the Ripper. Can you solve the riddle on this spooky Whitechapel Walk?\r\nCome along the trail of Jack the Ripperâ€¦ if you dare! ','2019-02-21 20:10:47','0000-00-00 00:00:00');
